  input: 'TEXT,"F3A","","This is in response to your letter of November 1, 2005, regarding
    the amended October Quarterly Report we filed on October 15, 2005. The first amended
    October Quarterly Report which was filed on April 25, 2005, reported the following:
    Disbursement to Kalyn Free for salary $50,000.00; Debt owed to Committee by Kalyn
    Free $14,341.47; Debt owed to Kalyn Free by Committee $14,000.00. Because of the
    question of what was allowable for salary by the candidate, the committee originally
    paid a salary of $50,000.00.  After receiving a notice from the FEC regarding
    this expenditure, it was determined that Ms. Free was entitled to a salary of
    $21,000.00.  At the same time, it was determined that Ms. Free had paid for numerous
    expenses out of pocket for which she had not been reimbursed, dating back to October
    17, 2003. The person completing the FEC reports at that time did not know how
    to report the various aspects of the expenditure.  We do not know how the -$14,000
    was determined to be debt owed to Kalyn Free by the committee, but this was clearly
    an error. This amendment reflects debt on Line 10 of $21,000 for salary and $14,658.53
    as expenses (these items were discussed in an earlier letter to you on 3/28/05).  This
    amendment also reflects the $50,000 payment to Kalyn Free, which as also discussed
    in the 3/28/05 letter, was $14,341.47 in excess.  This amount is listed on Line
    9 as debt owed to the committee by Ms. Free.  The Year-End report will reflect
    that Ms. Free has paid back this debt to the committee. With regards to the itemization
    of the expenses incurred by Ms. Free, the report has been amended to show those
    expenses which aggregate in excess of $200. If you have any other questions regarding
    this amendment, please let us know."'
